clear; close all; clc; 

r0 = [1500 0 2000]';
rdot0 = [-75 0 100]';
rf = [0 0 0]';

lb = r0(1) / abs(rdot0(1));
ub = 400 / (4.53*10^-4 * 6 * 0.3 * 3100 * cos(deg2rad(27)));
tol = 5e-1;

% [opt_t_f, optval, state_history, thrust_history] = gss(lb, ub, tol, r0, rdot0, rf);

tic
[status, optval, state_history, thrust_history] = powered_descent(r0, rdot0, rf, 81, 'Fuel'); %[output:51b2612e]
toc %[output:1b2a8d86]
figure(1) %[output:824f6222]
trajectory = tiledlayout(1, 1, "TileSpacing", "compact", "Padding", "compact"); %[output:824f6222]
set(gcf, 'Position', [100 100 800 800]) %[output:824f6222]
nexttile %[output:824f6222]
plot3(state_history(3,:), state_history(2,:), state_history(1,:), 'Color', 'black') %[output:824f6222]
grid on; %[output:824f6222]
hold on; %[output:824f6222]
plot3(r0(3), r0(2), r0(1), 'o', 'MarkerSize', 5) %[output:824f6222]
plot3(state_history(3, end), state_history(2, end), state_history(1, end), '.', 'MarkerSize', 15) %[output:824f6222]
xlabel('$z$ [m]') %[output:824f6222]
ylabel('$y$ [m]') %[output:824f6222]
zlabel('$x$ [m]') %[output:824f6222]
xlim([-4000 4000]) %[output:824f6222]
ylim([-4000 4000]) %[output:824f6222]
zlim([0 3000]) %[output:824f6222]
delta_t = opt_t_f/size(state_history, 2); %[output:16a6182e]
N = size(state_history, 2) - 1;
tspan = 0:delta_t:N*delta_t;

figure(2)
state_plot = tiledlayout(3, 1, "TileSpacing", "compact", "Padding", "compact");
set(gcf, "Position", [100 100 1500 1000])

nexttile
plot(tspan, state_history(1,:), 'r', tspan, state_history(2, :), 'g', tspan, state_history(3, :), 'b')
ylabel('$r(t)$')
grid on
legend('$x$', '$y$', '$z$')

nexttile
plot(tspan, state_history(4,:), 'r', tspan, state_history(5, :), 'g', tspan, state_history(6, :), 'b')
ylabel('$\dot{r}(t)$')
grid on
legend('$\dot{x}$', '$\dot{y}$', '$\dot{z}$')

nexttile
hold on
plot(tspan, thrust_history(1, :), 'r', tspan, thrust_history(2, :), 'g', tspan, thrust_history(3, :), 'b')
ylabel('$u(t)$')
xlabel('Time [s]')
grid on
legend('$u_x$', '$u_y$', '$u_z$')
%[text] 
function [opt_t_f, optval, state_history, thrust_history] = gss(lb, ub, tol, r0, rdot0, rf)
    gr = (sqrt(5) - 1)/2;
    d = gr * (ub - lb);
    
    x1 = lb + d;
    x2 = ub - d;
    
    while d > tol
        [x1_status, x1_optval, ~] = solve_fuel_optimal(r0, rdot0, rf, x1);
        [x2_status, x2_optval, ~] = solve_fuel_optimal(r0, rdot0, rf, x2);
    
        if ~strcmp(x1_status, 'Solved')
            x1_optval = 10^6;
        end
    
        if ~strcmp(x2_status, 'Solved')
            x2_optval = 10^6;
        end
    
        formatSpec = 'lb = %.2f, x1 = %.2f (%.4f), x2 = %.2f (%.4f), ub = %.2f\n';
        fprintf(formatSpec, lb, x1, x1_optval, x2, x2_optval, ub)
    
        if x1_optval < x2_optval
            lb = x2;
            d = gr * (ub - lb);
            x2 = x1;
            x1 = lb + d;
        elseif x1_optval > x2_optval
            ub = x1;
            d = gr * (ub - lb);
            x1 = x2;
            x2 = ub - d;
        end
        
        opt_t_f = (x1 + x2)/2;
    end
    
    [~, optval, state_history, thrust_history] = solve_fuel_optimal(r0, rdot0, rf, opt_t_f);
    fprintf('Optimal t_f: %.2f [s], Optimal Value: %.4f', opt_t_f, optval)
end

